import React, {Component} from 'react';
import Header from './components/Header'
import Content from './components/Content'
import Footer from './components/Footer'
import StateForComponentExample from './components/StateForComponentExample'
import ComponentLifeCycle from './components/ComponentLifeCycle'
import FormComponent from './components/FormComponent'
import SpisaciComponent from './components/SpisaciComponent'

class ImportsModule extends Component {}

module.exports = [Header,Content,Footer,StateForComponentExample,ComponentLifeCycle,FormComponent,SpisaciComponent,ImportsModule];
